comments.body:
The times you supplied to the command were formatted incorrectly -- replace the '.' characters with ':' characters and things should work correctly.  While request included the {{StartTime}} parameter as it should, the server seems to have returned a misleading error message after failing to parse what you supplied.  The current version of CloudWatch is much more helpful in diagnosing this:

{code}
euwatch-get-stats: error (MalformedInput): timestamp must follow ISO8601
{code}
